import React from 'react';

function Food({name}){
  return <h1>I Like {name}!</h1>
}

const foodILike = [
  { 
    name: "Kimchi",
    image: "data:image/jpeg;base64,"
  },
  {
    name: "Salmon",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQe6aAGrSFWlojXohiqfPm5MeoEyDpwxqC97A&usqp=CAU"
  }
]

function App() {
  return (
    <div>
      <h1>Hello!</h1>
      <Food name="titanic"/>
      <Food name="Lord of the rings"/>
      {foodILike.map(dish => <Food name={dish.name} picture={dish.image}/>)}
    </div>

  );
}

export default App;
